import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Home from './components/Home';
import LoginForm from './components/LoginForm';
import ProtectedRoute from './components/ProtectedRoute';
import About from './components/About';
import TaxUploader from './components/TaxUploader';
import History from './components/History'; // NEW: Import History component

function App() {
  return (
    <BrowserRouter>
      <Switch>
        {/* Public Routes */}
        <Route exact path="/login" component={LoginForm} />
        {/* Protected Routes */}
        <ProtectedRoute exact path="/" component={Home} />
        <ProtectedRoute exact path="/about" component={About} />
        <ProtectedRoute exact path="/start" component={TaxUploader} />
        <ProtectedRoute exact path="/history" component={History} /> {/* NEW: History Route */}
        
        {/* Optional: Add a catch-all for any other path to redirect to home if logged in, or login */}
        <Route component={LoginForm} /> {/* Redirects unknown paths to login if not protected */}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
